import React from "react"

export const LinksList = ({links}) => {
    return (
        <table>
            <thead>
            <tr>
                <th>Name</th>
                <th>Item Name</th>
                <th>Item Price</th>
            </tr>
            </thead>

            <tbody>
            { links.map(link => {
                return (
                    <tr>
                        <td>Alvin</td>
                        <td>Eclair</td>
                        <td>$0.87</td>
                    </tr>
                )
            }) }
            </tbody>
        </table>
    )
}
